import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';
import { Provider } from 'react-redux';
import createStore from './store';

const store = createStore();


ReactDOM.render(
    <Provider store={store}>

    </Provider>,
    document.getElementById('root')
  )
